import React from 'react';

function Footer() {
    const css = `
    .my-element {
        position:absolute;
        background-color: #89CFF0;
    }
    `
    return (
        <div class="my-element">
            <style>{css}</style>
            <p class="my-element">sponsored by googlemetaamazonandyourmom</p>
        </div>
    )
}

export default Footer;
